import React from "react";

const ResultsTable = ({ timesearch, isKMP }) => {
  if (!timesearch || (!timesearch.results.length && !timesearch.egrep.length)) {
    return <div className="text-center">Aucun résultat à afficher.</div>;
  }

  return (
    <div className="container mt-4">
      <h2 className="text-center mb-4">Résultats du test de Performance</h2>
      <div className="row">
        <div className="col-md-6">
          {isKMP ? <h4>KMP</h4> : <h4>Automate</h4>}
          <table className="table table-bordered">
            <thead className="thead-light">
              <tr>
                <th>Iteration</th>
                <th>Temps d'Exécution (ms)</th>
              </tr>
            </thead>
            <tbody>
              {timesearch.results.map((result, index) => (
                <tr key={index}>
                  <td>{result.iteration}</td>
                  <td>{(result.time * 1000).toFixed(6)} ms</td>{" "}
                  {/* Convertir le temps en ms */}
                </tr>
              ))}
            </tbody>
          </table>
        </div>

        <div className="col-md-6">
          <h4>Commande egrep</h4>
          <table className="table table-bordered">
            <thead className="thead-light">
              <tr>
                <th>Iteration</th>
                <th>Temps d'Exécution (ms)</th>
              </tr>
            </thead>
            <tbody>
              {timesearch.egrep.map((egrepResult, index) => (
                <tr key={index}>
                  <td>{egrepResult.iteration}</td>
                  <td>{egrepResult.executionTimeMs.toFixed(4)} ms</td>
                </tr>
              ))}
            </tbody>
          </table>
        </div>
      </div>
    </div>
  );
};

export default ResultsTable;
